var tipuesearch = {"pages": [{'title': 'About', 'text': '本學期的電腦輔助設計實習, 要求每一位學員根據本 HW template 的格式建立個人的作業倉儲與網頁. \n \n 你的學號  40923101\xa0\xa0 \n 網站倉儲:\xa0 https://github.com/a40923101/cad2021_hw \xa0 \n 網站連結:  https://a40923101.github.io/cad2021_hw \xa0 \n 其他與作者或作業相關資料說明或介紹 \n', 'tags': '', 'url': 'About.html'}, {'title': '筆記', 'text': '', 'tags': '', 'url': '筆記.html'}, {'title': '9444', 'text': '先打指令\xa0 cd tmp \n 再打 \xa0 cd cad2021_hw \n 然後打 \xa0 cms \xa0 \n 就會得到網址  https://127.0.0.1:9444/ \xa0複製下來 \n \n 按\xa0 login\xa0 登入(密碼\xa0 admin \xa0) \n', 'tags': '', 'url': '9444.html'}, {'title': '網際網路', 'text': '學校網路使用\xa0 ivp6 ，所以要把\xa0 ivp4\xa0 關掉 \n \n 設定DNS伺服器位址\xa0 2001:b000:168::1 \n \n 在小黑窗打上  ipconfig /all ，確認網路位址 \n \n \n 設定HTTY Proxy\xa0 2001:288:6004:17::42 \n \n 設定完成後，就可以上網了 \n', 'tags': '', 'url': '網際網路.html'}, {'title': 'ivp4', 'text': '在學校我們使用\xa0 ivp6 ，在家可以使用\xa0 ivp4 ，但\xa0 ivp4\xa0 有些地方要修改 \n 先開啟\xa0 start_ipv6 \n 然後把\xa0 start_ipv6\xa0 及\xa0 start_ipv4\xa0 都放進小白窗 \n \n \n 將 start_ipv6 複製下來到 start_ipv4 ，並按下 Search 的 replace \n \n 將\xa0 home_ipv6 \xa0 修改成\xa0 home_ipv4 ，並按下\xa0 Replace All \n \n 修改好後就可以\xa0 Save \n \n', 'tags': '', 'url': 'ivp4.html'}, {'title': 'wink', 'text': 'Google尋找  debugmode wink \n \n 將  wink  下載 \n \n 點開  winksetup ，按下  I Agree \n \n 按\xa0 Browse\xa0 將資料存在\xa0 date\xa0 裡的\xa0 wink ，最後\xa0 Install\xa0 就下載好了 \n \n 點開  wink.exe \n \n 開啟後就可以使用  wink  製作影片 \n \n \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'wink.html'}, {'title': 'run', 'text': '先複製老師給的程式碼 \n \n 點開Source code \n \n 將剛剛複製的程式碼放進去就可以了 \n \n  導入 brython 程式庫  \n \n \n  啟動 Brython  \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  印出版次與關鍵字程式  \n \n \n \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  Filename:  .py    存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div 作為切入位置  \n \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n \n', 'tags': '', 'url': 'run.html'}, {'title': 'HW1', 'text': '每一位學員透過程式亂數分配所使用的兩套參數式  CAD  套件 \n 從軟體發展緣起開始進行介紹 \n 經過教育版軟體套件檔案的取得 下載安裝 以及 配置使用。 \n 我分配到的是  NX   和  SOLVESPACE  這兩種 \n \n', 'tags': '', 'url': 'HW1.html'}, {'title': 'Solvespace', 'text': '\xa0 \xa0 \xa0 \xa0 \xa0 \n SolveSpace 是一個免費和開源的\xa0 2D  和  3D CAD \xa0 程序 \n 它是一個基於約束的 參數建模器 ，具有簡單的機械仿真功能 \n Solvespace\xa0 是一個 輕量級的程序 \n  它加載速度快效果很佳 \n 這個程序是由 喬納森·韋斯休斯 Jonathan Westhues  和 志願者社區 開發 \n 無論我們是在 2D 草圖拉伸還是裝配上 \n Solvespace  用戶界面都是 靜態的 \n 只要我們使用該程序\xa0 \n GUI\xa0 和 鍵盤快捷鍵 就不會更改 \n 這意味著可以以相同的方式在 2D 和 3D 中應用約束 \n 從而在使用\xa0 Solvespace\xa0 更加容易 \n', 'tags': '', 'url': 'Solvespace.html'}, {'title': 'Solvespace安裝配置', 'text': '先下載\xa0 SolveSpace \n \n 按下\xa0 Download \n \n 點開 \xa0 3.0stable \n \n 就來到 github ，在選擇 \xa0 solvespace.exe\xa0 下載下來 \n \n 下載完後將小白窗開啟，加入\xa0 star %Disk%solvespace.exe \xa0 ，儲存下來 \n \n 重啟 \xa0 start_ipv4 \xa0 後，就會直接開啟\xa0 solvespace \n \n', 'tags': '', 'url': 'Solvespace安裝配置.html'}, {'title': 'Solvespace操作流程', 'text': '先開啟  Solvespace \n \n 在  Sketch  裡的  image  載入圖片 \n \n 將照片載入好後就可以畫圖 \n \n \n', 'tags': '', 'url': 'Solvespace操作流程.html'}, {'title': 'SolveSpace運動場景', 'text': 'SolveSpace\xa0 零件轉出後轉入  CoppeliaSim  操作影片 \n \n SolveSpace\xa0 零件轉入\xa0 CoppeliaSim \xa0教學影片 (Wink) \n \n \n \n \n   \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'SolveSpace運動場景.html'}, {'title': 'NX', 'text': '\n NX\xa0 是  西門子 Siemens PLM Software\xa0 公司出品的一個產品工程解決方案 \n 它為用户的產品設計及加工過程提供了數字化造型和驗證手段 \n NX\xa0 這是一個交互式  CAD/CAM\xa0計算機輔助設計與計算機輔助製造 系統 \n 它功能強大可以輕鬆實現各種 複雜實體及造型 的建構 \n 它在誕生之初主要基於工作站 \n 但隨着\xa0 PC\xa0 硬件的發展和個人用户的迅速增長 \n 在  PC  上的應用取得了迅猛的增長 \n 已經成為模具行業三維設計的一個 主流應用 \n 來自\xa0 SiemensPLM  的  NX  使企業能夠通過新一代數字化產品開發系統 \n 實現向產品全生命週期管理轉型的目標 \n NX  包含了企業中應用最廣泛的集成應用套件 \n 用於產品設計、工程和製造全範圍的開發過程 \n', 'tags': '', 'url': 'NX.html'}, {'title': 'NX安裝配置', 'text': '下載 NX12可攜版本下載 \xa0( 必須先登入學校 帳號後才能下載 ) \n \n 按下載後解壓縮 \n \n \n', 'tags': '', 'url': 'NX安裝配置.html'}, {'title': 'NX操作流程', 'text': 'CAD2 零組件繪圖操作流程影片 (Youtube) \n CAD2 零組件繪圖教學影片 (Wink) \n \n \n', 'tags': '', 'url': 'NX操作流程.html'}, {'title': 'NX運動場景', 'text': 'NX\xa0 零件轉出後轉入  CoppeliaSim  操作影片 \n \n NX\xa0 零件轉入  CoppeliaSim  教學影片 (Wink) \n \n \n \n \n   \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'NX運動場景.html'}, {'title': 'HW1-1', 'text': 'HW1-1 佔學期成績 15% \n HW1-1 必須在 2021.12.01 22:00 之前完成. \n HW1-1 具體項目成果回報區 將於 2021.11.18 開啟, 於  2021.12.01 22:00 關閉. \n 作業 1-1: Mirobot 機械手臂場景組合 \n 說明: meArm Robot 有四個自由度, 請根據 HW1 的零組件繪製組立與 CoppeliaSim 運動場景模擬, 延伸至  Task1-1  中六個自由度的 Mirobot 機械手臂. \n mirobot_part1_to_part5.7z  為取自 \xa0 https://github.com/wlkata/Mirobot-STL  的參考零件. 請利用場景中 Mirobot STL 零件, 組合為可以透過  UI 介面 中的 slider 控制各軸作動旋轉的運動模型. \n 請根據  Task1-1  中的說明, 完成各項指定任務. \n', 'tags': '', 'url': 'HW1-1.html'}, {'title': 'HW2', 'text': 'HW2 佔學期成績 20% \n HW2 必須在 2021.12.22 22:00 之前完成. \n HW2 具體項目成果回報區 將於 2021.12.09 開啟, 於  2021.12.22 22:00 關閉. \n meArm 逆向運動學與網際參數式 CAD API 結合應用. \n 請將  https://github.com/mdecourse/meArm  中的 meArm Robot 逆向運動學程式, 改為 Lua 與 Python 程式, 使能套用至 HW1 所完成的 CoppeliaSim meArm 運動模擬場景. 並分別採 Lua, Legacy remote API 及 Bluezero remote API 逆向運動的方式進行控制. \n 請利用  Task2  中的 Solidworks, Inventor 與 NX API 程式控制 meArm Robot 零組件尺寸, 說明並討論如何透過網際程式控制 meArm Robot 的零件尺寸, 並結合上述逆向運動學程式庫, 使得自動化機電產品開發流程更容易滿足客製化需求. \n 參考: \n 2016_ADDITIVE MANUFACTURING PROCESSES FOR FABRICATING A MINI ROBOT - COMPUTATIONAL MODELS AND EXPERIMENTAL RESULTS.pdf \n Robot Manipulator Control with Inverse Kinematics PD-Pseudoinverse Jacobian and Forward Kinematics Denavit Hartenber.pdf \n KINEMATIC ANALYSIS FOR ROBOT ARM.pdf \n https://codebender.cc/user/MeArm \n https://github.com/mdecourse/meArmPi \n /downloads/MeArmPiTechnicalOverviewV0-3DRAFT.pdf \n https://github.com/mdecourse/me-arm-ik \n https://github.com/mdecourse/mearm_model \n https://courses.ece.cornell.edu/ece5990/ECE5725_Fall2016_Projects/pas324_ml634/index.html \n https://github.com/mdecourse/InefficientSkittleSorter \n https://mearm.com \n', 'tags': '', 'url': 'HW2.html'}, {'title': 'HW3', 'text': 'HW3 為選項作業. \n HW3 具體項目成果回報區 將於 2021.12.09 開啟, 於  2022.01.05 22:00 關閉 \n https://mde.tw/cad2021/content/Task3.html \xa0 \n https://mde.tw/cad2021/content/Task4.html \n https://mde.tw/cad2021/content/Task5.html \n https://mde.tw/cad2021/content/Task6.html \n https://mde.tw/cad2021/content/Task7.html \n 請從上列 Tasks 中自行選擇項目內容完成 HW3. \n', 'tags': '', 'url': 'HW3.html'}, {'title': 'Final Project', 'text': 'Final Project 佔學期成績 40% \n 2a 與 2b 必須在 2022.01.06 上課之前完成 Final Project \n Final Project 具體項目成果回報區 將於 2021.12.09 開啟, 於  2022.01.05 22:00 關閉 \n 彈性製造系統場景設計與製作 \n 請從  https://github.com/mdecourse/scenes  與  https://github.com/mdecourse/models  中選擇場景或模型, 配合  cad2021_textbook.pdf  (登入 @gm 帳號後下載) 教材中的內容, 自選製作與組立產品, 組合成一個 Flexible Manufacturing System 系統場景. \n 彈性製造系統內容說明 \n 範例: \n \n', 'tags': '', 'url': 'Final Project.html'}]};